pragma solidity ^0.8.0;


contract lol_auction{
    address payable benecifiary;
    

    address public highestBider;
    uint public highestBid;
    uint public tokenid;
    
    mapping (address => uint) pendingReturns;
    mapping (uint => auction) curr_auction_map;
    
    struct auction{
        uint tokenID;
        string image;
        uint timestamp;
        uint curr_timer;
        
        address Bider;
        address payable benecifiary;
        uint Bidsize; 
        bool status;
        string token_uri;
    } 
    
    auction auc_on;
    bool ended = false;
    bool new_game= false;
    uint _tokenCounter_;
    uint newtokenCounter;
    
    event HighestBidIncrease(address bidder, uint amount);
    
    event AuctionEnded(address winner, uint amount, address benecifiary);
    
    event curr_time(address curr_sender, uint time, uint size);
    
    event curr_value_(address starter, address highestbidder, uint bidsize);

    event curr_new_value_(address starter, address highestbidder, uint bidsize, uint biddingtime, string image, string token_URI);
    
    event curr_bider_(address bider);
    
    event curr_amount_(uint bider);
     
    function on_auction(uint _biddingtime, address payable _benecifiary, uint _tokenid, string memory _image, string memory token_URI) public payable returns (uint, address, uint, uint){
        benecifiary = _benecifiary;
        tokenid = _tokenid;
        
        
        uint auctionendTime = block.timestamp +  _biddingtime;
        
        curr_auction_map[_tokenCounter_] = auction(_tokenid, _image, auctionendTime, block.timestamp, msg.sender, _benecifiary, 0, true, token_URI);
        _tokenCounter_ += 1;

        newtokenCounter += 1;

        return (_biddingtime, benecifiary, _tokenid, auctionendTime );   
    }

      function get_all_auctions_() public payable returns (auction[] memory){
      auction[] memory allauction = new auction[](newtokenCounter);
      for (uint i = 0; i < newtokenCounter; i++) {
          //uint curr_id = curr_auction_map[i].tokenID;
          auction storage allauctions = curr_auction_map[i];
          
          emit curr_new_value_(curr_auction_map[i].Bider, curr_auction_map[i].benecifiary,
          curr_auction_map[i].Bidsize, curr_auction_map[i].timestamp,
          curr_auction_map[i].image, curr_auction_map[i].token_uri);

          if(curr_auction_map[i].status == true){
              allauction[i] = allauctions;
          }
      }
      return allauction;
  }
    
    function bid(uint _id)public payable {
        for (uint i = 0; i < _tokenCounter_; i++) {
         if(curr_auction_map[i].tokenID == _id){
            
            if(block.timestamp > curr_auction_map[i].timestamp){
         
            revert("The auction has already ended");
            }
        
                if(msg.value <= curr_auction_map[i].Bidsize){
                    revert("There is already a higher Bid!");
                }
                
                curr_auction_map[i].Bider = msg.sender;
                curr_auction_map[i].Bidsize = msg.value;
                
                if(curr_auction_map[i].Bidsize != 0 ){
                    
                    
                    emit curr_bider_(curr_auction_map[i].Bider);
                    pendingReturns[curr_auction_map[i].Bider] += curr_auction_map[i].Bidsize;
                    
                    emit curr_amount_(pendingReturns[curr_auction_map[i].Bider]);
                }
                
               
                emit HighestBidIncrease(curr_auction_map[i].Bider, curr_auction_map[i].Bidsize);
                
        }
     
        
        }
    }
  
    function get_auctionTime(uint _id) public virtual returns(uint){
        
        uint _time;
        for (uint i = 0; i < _tokenCounter_; i++) {
            if(curr_auction_map[i].tokenID == _id){
                _time = curr_auction_map[i].curr_timer;
                emit curr_time(curr_auction_map[i].Bider, curr_auction_map[i].curr_timer, curr_auction_map[i].Bidsize);
            }
        }
        return _time;
    }
    
     function get_timer() public virtual returns(uint){
  
        return block.timestamp;
    }
    
    function get_time_bider(uint _id) public virtual returns(uint){
       uint curr_highestBid;
       
        for (uint i = 0; i < _tokenCounter_; i++) {
            if(curr_auction_map[i].tokenID == _id){
                curr_highestBid = curr_auction_map[i].Bidsize;
                emit curr_time(curr_auction_map[i].Bider, curr_auction_map[i].timestamp, curr_highestBid);
            }
        }
        
        return curr_highestBid;
    }
    
    function get_bider_(uint _id) public virtual returns(address){
       address curr_get_bider_;
       
        for (uint i = 0; i < _tokenCounter_; i++) {
            if(curr_auction_map[i].tokenID == _id){
                curr_get_bider_ = curr_auction_map[i].Bider;
                emit curr_time(curr_auction_map[i].Bider, curr_auction_map[i].timestamp, curr_auction_map[i].Bidsize);
            }
        }
        return curr_get_bider_;
    }

     function get_id_(uint _id) public virtual returns(address){
       address curr_id;
       
        for (uint i = 0; i < _tokenCounter_; i++) {
            if(curr_auction_map[i].tokenID == _id){
                curr_id = curr_auction_map[i].Bider;
                emit curr_time(curr_auction_map[i].Bider, curr_auction_map[i].timestamp, curr_auction_map[i].Bidsize);
            }
        }
        return curr_id;
    }
    
      function get_pengingamount_(address _id) public virtual returns(uint){
       
        return pendingReturns[_id];
    }
    

    
    function withdraw(uint _id, address _input) public virtual returns(bool){
        for (uint i = 0; i < _tokenCounter_; i++) {
            
         if(curr_auction_map[i].tokenID == _id){
                uint amount = pendingReturns[_input];
                
                emit curr_amount_(pendingReturns[_input]);
                
                if(amount > 0){
                    pendingReturns[_input] = 0;
                    
                    emit curr_bider_(_input);
    
                    emit curr_amount_(amount);
                    
                    if(!payable(_input).send(amount)){
                        pendingReturns[_input] = amount;
                        return false;
                }
            }
        }
    }
    
       
        return true;
}
    
     //0x5B38Da6a701c568545dCfcB03FcB875f56beddC4
     //0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2
     
     //0x4B20993Bc481177ec7E8f571ceCaE8A9e22C02db
     //0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB
    
    function auctionEnd(uint _id) public payable virtual{
        
        for (uint i = 0; i < _tokenCounter_; i++) {
        
        if(curr_auction_map[i].tokenID == _id){
            if(block.timestamp < curr_auction_map[i].timestamp){
                revert("The auction has not ended yet");
            }
                pendingReturns[curr_auction_map[i].Bider] = 0;
                
                curr_auction_map[i].benecifiary.transfer(curr_auction_map[i].Bidsize);
                
                curr_auction_map[i].Bidsize = 0;
                
                curr_auction_map[i].status = false;
                
                ended = true;
        
           }
        }
        
    }
    
    
}
